import { Button } from "@mui/material";
import React, {useState} from "react";
import styled from 'styled-components'

export default function Todo() {
    const [count, setTodo] = useState('')
    return (<TodoDiv>
        <h1>todo 페이지</h1>
        <p>할 일: {count}</p>
        <Button variant="outlined" onClick={() => setTodo(count.append('a'))}>추가</Button>
        <Button variant="outlined" onClick={() => setTodo(count.pop())}>삭제</Button>
    </TodoDiv>)
}

const TodoDiv = styled.div` text-align: center; `
